import tkinter as tk
from tkinter import messagebox
import time, threading, base64, tempfile, os, pygame

# ================== EMBEDDED SOUND DATA ==================
HALF_WAV = """"""
END_WAV = """"""
# =========================================================

def write_temp_sound(data, filename):
    path = os.path.join(tempfile.gettempdir(), filename)
    with open(path, "wb") as f:
        f.write(base64.b64decode(data))
    return path


class TimerApp:
    def __init__(self, root):
        self.root = root
        self.root.title("Desktop Timer")
        self.root.geometry("280x190")   # slightly taller for hh:mm:ss
        self.root.configure(bg="black")

        self.time_left = 0
        self.running = False
        self.half_played = False

        pygame.mixer.init()

        self.half_sound = write_temp_sound(HALF_WAV, "half.wav")
        self.end_sound = write_temp_sound(END_WAV, "end.wav")

        # Overlay toggle (top right)
        self.overlay_var = tk.BooleanVar()
        self.overlay_btn = tk.Checkbutton(root, text="🖵", variable=self.overlay_var,
                                          command=self.toggle_overlay, bg="black",
                                          fg="white", font=("Helvetica", 10), selectcolor="black")
        self.overlay_btn.place(x=240, y=5)  # pinned at top-right corner

        # Timer display (HH:MM:SS)
        self.label = tk.Label(root, text="00:00:00", font=("Helvetica", 28), fg="lime", bg="black")
        self.label.pack(pady=10)

        # Time entry
        self.entry = tk.Entry(root, font=("Helvetica", 12), justify="center", width=10)
        self.entry.insert(0, "hh:mm:ss")
        self.entry.pack(pady=3)

        # Buttons (smaller)
        btn_frame = tk.Frame(root, bg="black")
        btn_frame.pack(pady=5)

        self.start_btn = tk.Button(btn_frame, text="Start", command=self.start_timer, width=6, height=1)
        self.start_btn.grid(row=0, column=0, padx=4)

        self.pause_btn = tk.Button(btn_frame, text="Pause", command=self.pause_timer, width=6, height=1)
        self.pause_btn.grid(row=0, column=1, padx=4)

        self.reset_btn = tk.Button(btn_frame, text="Reset", command=self.reset_timer, width=6, height=1)
        self.reset_btn.grid(row=0, column=2, padx=4)

        # Stop sound button
        self.stop_sound_btn = tk.Button(root, text="Stop Sound", command=self.stop_sound,
                                        width=12, height=1, bg="red", fg="white")
        self.stop_sound_btn.pack(pady=5)

        self.root.protocol("WM_DELETE_WINDOW", self.on_close)

    def parse_time(self, time_str):
        """Parses hh:mm:ss, mm:ss, or ss into total seconds"""
        parts = time_str.strip().split(":")
        try:
            if len(parts) == 3:  # hh:mm:ss
                h, m, s = map(int, parts)
                return h * 3600 + m * 60 + s
            elif len(parts) == 2:  # mm:ss
                m, s = map(int, parts)
                return m * 60 + s
            elif len(parts) == 1:  # ss
                return int(parts[0])
        except:
            return None
        return None

    def format_time(self, seconds):
        """Convert total seconds to hh:mm:ss"""
        h = seconds // 3600
        m = (seconds % 3600) // 60
        s = seconds % 60
        return f"{h:02}:{m:02}:{s:02}"

    def start_timer(self):
        if not self.running:
            try:
                if self.time_left == 0:
                    time_str = self.entry.get()
                    total = self.parse_time(time_str)
                    if total is None:
                        raise ValueError
                    self.time_left = total
                    self.half_played = False
                self.running = True
                threading.Thread(target=self.countdown, daemon=True).start()
            except:
                messagebox.showerror("Invalid Input", "Enter time as hh:mm:ss / mm:ss / ss")

    def pause_timer(self):
        self.running = False

    def reset_timer(self):
        self.running = False
        self.time_left = 0
        self.label.config(text="00:00:00")
        self.stop_sound()

    def stop_sound(self):
        pygame.mixer.stop()

    def toggle_overlay(self):
        """Force strict always on top"""
        state = self.overlay_var.get()
        self.root.attributes("-topmost", state)
        self.root.wm_attributes("-topmost", state)
        if state:
            self.root.after(1000, self.enforce_topmost)

    def enforce_topmost(self):
        if self.overlay_var.get():
            self.root.attributes("-topmost", True)
            self.root.wm_attributes("-topmost", True)
            self.root.after(1000, self.enforce_topmost)

    def countdown(self):
        total_time = self.time_left
        while self.running and self.time_left > 0:
            self.label.config(text=self.format_time(self.time_left))
            time.sleep(1)
            self.time_left -= 1

            if not self.half_played and self.time_left == total_time // 2:
                pygame.mixer.Sound(self.half_sound).play()
                self.half_played = True

        if self.time_left == 0 and self.running:
            self.label.config(text="00:00:00")
            pygame.mixer.Sound(self.end_sound).play(-1)
            messagebox.showinfo("Timer Done", "Time’s up!")

        self.running = False

    def on_close(self):
        self.stop_sound()
        pygame.mixer.quit()
        self.root.destroy()


if __name__ == "__main__":
    root = tk.Tk()
    app = TimerApp(root)
    root.mainloop()